people = []

raws.each do |raw|
  raw["hits"].each do |person|

    people << {
      title: person["title"],
      name: person["name"],
      organization: person["organization_name"],
      url: person["url"]
    }
  end
end

people.each do |person|
  begin
    permalink = person[:url]
    uri = "http://www.crunchbase.com#{permalink}"
    p uri
    response = RestClient.get(uri)
    body = response.body
    org = body.scan(/\"\/organization\/[A-z-]*\"/).first
    org.gsub!("\"", "")
    person[:organization_url] = org
  rescue Exception => e
  end
end

people.each do |person|
  begin
    permalink = person[:organization_url]
    uri = "http://api.crunchbase.com/v/2#{permalink}?user_key=e06a4ca62b6ed767158946013cc4a6f9"
    p uri
    response = RestClient.get(uri)
    json = JSON.parse(response.body)
    person[:domain] = json["data"]["properties"]["homepage_url"]
  rescue Exception => e
  end
end


CSV.open("crunchbase_2.csv", "wb") do |csv|
  people.each do |person|
    csv << [person[:name], person[:title], person[:organization], person[:domain]]
  end
end
